double linearInterpolation(double x, double x1, double x2, double f1, double f2)
{ // y = y1 + ((x – x1) / (x2 – x1)) * (y2 – y1)
    return f1 + (x - x1) / (x2 - x1) * (f2 - f1);
}

double arsinh_interval_iteration(double input, double x2, double *lut)
{
    for (int i = 0; i < 100; i++) // size of lut = 100
    {
        // get previous x
        double pastX = x2 / 1.08;

        // value is between previous x and x2
        if (input > pastX && input < x2)
        {
            return i - 1 != -1 ? linearInterpolation(input, pastX, x2, lut[i - 1], lut[i]) : lut[i];
        }

        // input is value in look up table
        if (input - x2 < MIN_X_LUT0)
        {
            return lut[i];
        }

        // new x = previous x * 1.08
        x2 *= 1.08;
    }
    return 0.0;
}

