double approxArsinh_lookup(double x)
{
    double arsinh = 0.0;

    if (x < 0)
    {
        arsinh = grab_arsinh_value(-x);
        arsinh *= -1;
    }
    else
    {
        arsinh = grab_arsinh_value(x);
    }

    return arsinh;
}